let lastMatchedCore = 'Draco';

function findKeyStartsWith(str) {
    const keys = Object.keys(mixFormulas);
    for (let i = 0; i < keys.length; i++) {
        if (keys[i].toLocaleLowerCase().startsWith(str.toLocaleLowerCase())) {
            return keys[i];
        }
    }
    return undefined;
}


function addFormula(core, depth=0) {
    // Return if it's too deep
    if(depth > 3) return;
    // Return if it doesn't have any mix formulas
    if(!mixFormulas[core].length) return;
    const root = document.getElementById(core);
    const ul = document.createElement('ul');
    const liLeft = document.createElement('li');
    const liRight = document.createElement('li');
    const aLeft = document.createElement('a');
    const aRight = document.createElement('a');
    root.appendChild(ul);
    ul.appendChild(liLeft);
    ul.appendChild(liRight);
    liLeft.appendChild(aLeft);
    liRight.appendChild(aRight);
    liLeft.id = mixFormulas[core][0][0].name;
    liRight.id = mixFormulas[core][0][1].name;
    aLeft.textContent = mixFormulas[core][0][0].name;
    aRight.textContent = mixFormulas[core][0][1].name;
    addFormula(mixFormulas[core][0][0].name, depth+1);
    liLeft.removeAttribute('id');
    addFormula(mixFormulas[core][0][1].name, depth+1);
    liRight.removeAttribute('id');

}

function getFormula(core) {
    // If the user is not giving proper name, we will try to find the closest match.
    if(!mixFormulas[core]) {
        core = findKeyStartsWith(core);
        if(!core) {
            core = lastMatchedCore;
        }
        else {
            lastMatchedCore = core;
        }
    }

    const root = document.getElementById('root');
    const ul = document.createElement('ul');
    const li = document.createElement('li');
    const a = document.createElement('a');

    // First clear the root
    while (root.firstChild) {
        root.removeChild(root.firstChild);
    }

    // Then add the new core
    root.appendChild(ul);
    ul.appendChild(li);
    li.appendChild(a);
    li.id = core;
    a.textContent = core;
    addFormula(core)
}

const coreSelector = document.getElementById('core-selector')
coreSelector.addEventListener('keyup', function() {
    getFormula(this.value);
})